import logo from "./logo.svg";
import "./App.css";
import NavBar from "./NavBar";
import { Route, Routes } from "react-router-dom";
import MainPage from "./MainPage";

function App() {
  return (
    <div className="App">
      <header className="App-header"></header>
      <body>
        <NavBar />
        <Routes>
          <Route
            exact
            path="/"
            element={<MainPage/>}
          />
          <Route
            exact
            path="/product/list"
            // element={}
          />
          <Route
            exact
            path="/bookmark"
            // element={}
          />
        </Routes>
      </body>
      <footer></footer>
    </div>
  );
}

export default App;
